msItem.note:
Calendar for April through December (first three months
lacking); calendar is full; major feasts in gold; three saints (Modoaldus, Vitus, Martinus) in gold;
Egyptian days and zodiacal notes in red; other text in brown ink

history.provenance:
Petrus Grillinger, Canon of Salzburg, early fifteenth century;
inscription on fol. 126v reads "Hic liber fuit domini petri Grillinger Magistri Kamere Curie
Salzbur[gensis]"
